import React from 'react'
import Catalogue from '../Data/Catalogue'

function CatalogueCards() {
    return (
        <div className="">
            <div className="">
                {
                    Catalogue.map((item) => {
                        return(
                            <div className="">
                                <div className="">
                                    {item.imgurl}
                                </div>
                                <div>
                                    <h3>{item.Name}</h3>
                                </div>
                                <div>
                                    <h3>{item.price}</h3>
                                </div>
                                <div>
                                    <h3>{item.stock}</h3>
                                </div>
                            </div>
                        )
                    })
                }
            </div>

        </div>
    )
}

export default CatalogueCards
